import './Gif.css'
import '../ListOfGifs/ListOfGifs.css';
import { Link, Route } from 'wouter';

export default function Gif({id,title,url}) {

  return (
    <Link to={`/gif/${id}`}>
      <a>
        href={`#${id}`}
        className='ListOfGifs-item'>  
          <img alt={title} src={url} />
          <h4>{title}</h4>
      </a>
    </Link>
  )
}
